				const html = updateImageReferences("<h1 id=\"vue-component-testing-with-cypress\">Vue Component Testing with Cypress</h1>\n<p>see also <a href=\"https://docs.cypress.io/guides/component-testing/vue/quickstart#Getting-Started\">Getting started</a> and <a href=\"https://docs.cypress.io/guides/component-testing/vue/overview#Framework-Support\">Framework Support</a></p>\n<p>Cypress Component Testing supports Vue 2+ with the following frameworks:</p>\n<ul>\n<li>Vue CLI</li>\n<li>Nuxt Alpha</li>\n<li>Vue with Vite</li>\n<li>Vue with Webpack</li>\n</ul>\n<p>To get up and running with Cypress Component Testing in React, install Cypress into your project:</p>\n<p><code>npm i cypress -D</code></p>\n<p>Open Cypress:</p>\n<p><code>npx cypress open</code></p>\n<p>The Cypress Launchpad will guide you through configuring your project.</p>\n<h3 id=\"creating-and-testing-a-component\">Creating and testing a Component</h3>\n<p>Example component (in src/components/Stepper.vue):</p>\n<pre is:raw=\"\" class=\"astro-code\" style=\"background-color: #0d1117; overflow-x: auto;\"><code><span class=\"line\"><span style=\"color: #C9D1D9\">&#x3C;</span><span style=\"color: #7EE787\">template</span><span style=\"color: #C9D1D9\">></span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  &#x3C;</span><span style=\"color: #7EE787\">div</span><span style=\"color: #C9D1D9\">></span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    &#x3C;</span><span style=\"color: #7EE787\">button</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #79C0FF\">data-cy</span><span style=\"color: #C9D1D9\">=</span><span style=\"color: #A5D6FF\">\"decrement\"</span><span style=\"color: #C9D1D9\"> @</span><span style=\"color: #79C0FF\">click</span><span style=\"color: #C9D1D9\">=</span><span style=\"color: #C9D1D9\">\"</span><span style=\"color: #C9D1D9\">decrement</span><span style=\"color: #C9D1D9\">\"</span><span style=\"color: #C9D1D9\">>-&#x3C;/</span><span style=\"color: #7EE787\">button</span><span style=\"color: #C9D1D9\">></span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    &#x3C;</span><span style=\"color: #7EE787\">span</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #79C0FF\">data-cy</span><span style=\"color: #C9D1D9\">=</span><span style=\"color: #A5D6FF\">\"counter\"</span><span style=\"color: #C9D1D9\">>{{ count }}&#x3C;/</span><span style=\"color: #7EE787\">span</span><span style=\"color: #C9D1D9\">></span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    &#x3C;</span><span style=\"color: #7EE787\">button</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #79C0FF\">data-cy</span><span style=\"color: #C9D1D9\">=</span><span style=\"color: #A5D6FF\">\"increment\"</span><span style=\"color: #C9D1D9\"> @</span><span style=\"color: #79C0FF\">click</span><span style=\"color: #C9D1D9\">=</span><span style=\"color: #C9D1D9\">\"</span><span style=\"color: #C9D1D9\">increment</span><span style=\"color: #C9D1D9\">\"</span><span style=\"color: #C9D1D9\">>+&#x3C;/</span><span style=\"color: #7EE787\">button</span><span style=\"color: #C9D1D9\">></span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  &#x3C;/</span><span style=\"color: #7EE787\">div</span><span style=\"color: #C9D1D9\">></span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">&#x3C;/</span><span style=\"color: #7EE787\">template</span><span style=\"color: #C9D1D9\">></span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">&#x3C;</span><span style=\"color: #7EE787\">script</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #79C0FF\">setup</span><span style=\"color: #C9D1D9\">></span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { ref } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'vue'</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">const</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #79C0FF\">props</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">defineProps</span><span style=\"color: #C9D1D9\">([</span><span style=\"color: #A5D6FF\">'initial'</span><span style=\"color: #C9D1D9\">])</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">const</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #79C0FF\">emit</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">defineEmits</span><span style=\"color: #C9D1D9\">([</span><span style=\"color: #A5D6FF\">'change'</span><span style=\"color: #C9D1D9\">])</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">const</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #79C0FF\">count</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">ref</span><span style=\"color: #C9D1D9\">(props.initial </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #79C0FF\">0</span><span style=\"color: #C9D1D9\">)</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">const</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">increment</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> () </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    count.value</span><span style=\"color: #FF7B72\">++</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    </span><span style=\"color: #D2A8FF\">emit</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'change'</span><span style=\"color: #C9D1D9\">, count.value)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  }</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">const</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">decrement</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> () </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    count.value</span><span style=\"color: #FF7B72\">--</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    </span><span style=\"color: #D2A8FF\">emit</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'change'</span><span style=\"color: #C9D1D9\">, count.value)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  }</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">&#x3C;/</span><span style=\"color: #7EE787\">script</span><span style=\"color: #C9D1D9\">></span></span></code></pre>\n<p>mounting the component:</p>\n<pre is:raw=\"\" class=\"astro-code\" style=\"background-color: #0d1117; overflow-x: auto;\"><code><span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> Stepper </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'./Stepper.vue'</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #D2A8FF\">describe</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'&#x3C;Stepper />'</span><span style=\"color: #C9D1D9\">, () </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #D2A8FF\">it</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'renders'</span><span style=\"color: #C9D1D9\">, () </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    </span><span style=\"color: #8B949E\">// see: https://test-utils.vuejs.org/guide/</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    cy.</span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(Stepper)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  })</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">})</span></span></code></pre>\n<h4 id=\"example-test-for-the-stepper-component\">Example test for the Stepper component</h4>\n<pre is:raw=\"\" class=\"astro-code\" style=\"background-color: #0d1117; overflow-x: auto;\"><code><span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> Stepper </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'./Stepper.vue'</span></span>\n<span class=\"line\"><span style=\"color: #D2A8FF\">describe</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'&#x3C;Stepper>'</span><span style=\"color: #C9D1D9\">, () </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #D2A8FF\">it</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'stepper should default to 0'</span><span style=\"color: #C9D1D9\">, () </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    cy.</span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(Stepper)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    cy.</span><span style=\"color: #D2A8FF\">get</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'[data-cy=counter]'</span><span style=\"color: #C9D1D9\">).</span><span style=\"color: #D2A8FF\">should</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'have.text'</span><span style=\"color: #C9D1D9\">, </span><span style=\"color: #A5D6FF\">'0'</span><span style=\"color: #C9D1D9\">)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  })</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #D2A8FF\">it</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'supports an \"initial\" prop to set the value'</span><span style=\"color: #C9D1D9\">, () </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    cy.</span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(Stepper, { props: { initial: </span><span style=\"color: #79C0FF\">100</span><span style=\"color: #C9D1D9\"> } })</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    cy.</span><span style=\"color: #D2A8FF\">get</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'[data-cy=counter]'</span><span style=\"color: #C9D1D9\">).</span><span style=\"color: #D2A8FF\">should</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'have.text'</span><span style=\"color: #C9D1D9\">, </span><span style=\"color: #A5D6FF\">'100'</span><span style=\"color: #C9D1D9\">)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  })</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #D2A8FF\">it</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'when the increment button is pressed, the counter is incremented'</span><span style=\"color: #C9D1D9\">, () </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    cy.</span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(Stepper)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    cy.</span><span style=\"color: #D2A8FF\">get</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'[data-cy=increment]'</span><span style=\"color: #C9D1D9\">).</span><span style=\"color: #D2A8FF\">click</span><span style=\"color: #C9D1D9\">()</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    cy.</span><span style=\"color: #D2A8FF\">get</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'[data-cy=counter]'</span><span style=\"color: #C9D1D9\">).</span><span style=\"color: #D2A8FF\">should</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'have.text'</span><span style=\"color: #C9D1D9\">, </span><span style=\"color: #A5D6FF\">'1'</span><span style=\"color: #C9D1D9\">)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  })</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #D2A8FF\">it</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'when the decrement button is pressed, the counter is decremented'</span><span style=\"color: #C9D1D9\">, () </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    cy.</span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(Stepper)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    cy.</span><span style=\"color: #D2A8FF\">get</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'[data-cy=decrement]'</span><span style=\"color: #C9D1D9\">).</span><span style=\"color: #D2A8FF\">click</span><span style=\"color: #C9D1D9\">()</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    cy.</span><span style=\"color: #D2A8FF\">get</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'[data-cy=counter]'</span><span style=\"color: #C9D1D9\">).</span><span style=\"color: #D2A8FF\">should</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'have.text'</span><span style=\"color: #C9D1D9\">, </span><span style=\"color: #A5D6FF\">'-1'</span><span style=\"color: #C9D1D9\">)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  })</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #D2A8FF\">it</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'clicking + fires a change event with the incremented value'</span><span style=\"color: #C9D1D9\">, () </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    </span><span style=\"color: #FF7B72\">const</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #79C0FF\">onChangeSpy</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> cy.</span><span style=\"color: #D2A8FF\">spy</span><span style=\"color: #C9D1D9\">().</span><span style=\"color: #D2A8FF\">as</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'onChangeSpy'</span><span style=\"color: #C9D1D9\">)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    cy.</span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(Stepper, { props: { onChange: onChangeSpy } })</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    cy.</span><span style=\"color: #D2A8FF\">get</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'[data-cy=increment]'</span><span style=\"color: #C9D1D9\">).</span><span style=\"color: #D2A8FF\">click</span><span style=\"color: #C9D1D9\">()</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    cy.</span><span style=\"color: #D2A8FF\">get</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'@onChangeSpy'</span><span style=\"color: #C9D1D9\">).</span><span style=\"color: #D2A8FF\">should</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'have.been.calledWith'</span><span style=\"color: #C9D1D9\">, </span><span style=\"color: #79C0FF\">1</span><span style=\"color: #C9D1D9\">)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  })</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">})</span></span></code></pre>\n<p>See more examples at <a href=\"https://docs.cypress.io/guides/component-testing/vue/examples\">Vue Examples</a></p>\n<h3 id=\"custom-mount-commands\">Custom Mount Commands</h3>\n<p>While you can use the mount() function in your tests, cypress recommends using cy.mount(), which is a custom command that is defined in the cypress/support/component.js file:</p>\n<pre is:raw=\"\" class=\"astro-code\" style=\"background-color: #0d1117; overflow-x: auto;\"><code><span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { mount } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'cypress/vue'</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">Cypress.Commands.</span><span style=\"color: #D2A8FF\">add</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'mount'</span><span style=\"color: #C9D1D9\">, mount)</span></span></code></pre>\n<p>This allows you to use cy.mount() in any test without having to import the mount() function in each and every spec file.</p>\n<p>By default, cy.mount() is a simple passthrough to mount(), however, you can customize cy.mount() to fit your needs. For instance, if you are using plugins or other global app-level setups in your Vue app, you can configure them here.</p>\n<h3 id=\"replicating-plugins\">Replicating Plugins</h3>\n<p>Most applications will have state management or routing. Both of these are Vue plugins:</p>\n<p>in cypress/support/component.js</p>\n<pre is:raw=\"\" class=\"astro-code\" style=\"background-color: #0d1117; overflow-x: auto;\"><code><span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { createPinia } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'pinia'</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #8B949E\">// or Vuex</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { createI18n } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'vue-i18n'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { mount } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'cypress/vue'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { h } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'vue'</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #8B949E\">// We recommend that you pull this out</span></span>\n<span class=\"line\"><span style=\"color: #8B949E\">// into a constants file that you share with</span></span>\n<span class=\"line\"><span style=\"color: #8B949E\">// your main.js file.</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">const</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #79C0FF\">i18nOptions</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  locale: </span><span style=\"color: #A5D6FF\">'en'</span><span style=\"color: #C9D1D9\">,</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  messages: {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    en: {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">      hello: </span><span style=\"color: #A5D6FF\">'hello!'</span><span style=\"color: #C9D1D9\">,</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    },</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    ja: {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">      hello: </span><span style=\"color: #A5D6FF\">'こんにちは！'</span><span style=\"color: #C9D1D9\">,</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    },</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  },</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">}</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">Cypress.Commands.</span><span style=\"color: #D2A8FF\">add</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'mount'</span><span style=\"color: #C9D1D9\">, (</span><span style=\"color: #FFA657\">component</span><span style=\"color: #C9D1D9\">, </span><span style=\"color: #FF7B72\">...</span><span style=\"color: #FFA657\">args</span><span style=\"color: #C9D1D9\">) </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  args.global </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> args.global </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> {}</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  args.global.plugins </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> args.global.plugins </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> []</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  args.global.plugins.</span><span style=\"color: #D2A8FF\">push</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #D2A8FF\">createPinia</span><span style=\"color: #C9D1D9\">())</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  args.global.plugins.</span><span style=\"color: #D2A8FF\">push</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #D2A8FF\">createI18n</span><span style=\"color: #C9D1D9\">())</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">return</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(() </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    </span><span style=\"color: #FF7B72\">return</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">h</span><span style=\"color: #C9D1D9\">(VApp, {}, component)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  }, </span><span style=\"color: #FF7B72\">...</span><span style=\"color: #C9D1D9\">args)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">})</span></span></code></pre>\n<h3 id=\"vue-router\">Vue Router</h3>\n<p>To use Vue Router, create a command to register the plugin and pass in a custom implementation of the router via the options param:</p>\n<p>Vue 3:</p>\n<pre is:raw=\"\" class=\"astro-code\" style=\"background-color: #0d1117; overflow-x: auto;\"><code><span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { mount } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'cypress/vue'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { createMemoryHistory, createRouter } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'vue-router'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { routes } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'../../src/router'</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">Cypress.Commands.</span><span style=\"color: #D2A8FF\">add</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'mount'</span><span style=\"color: #C9D1D9\">, (</span><span style=\"color: #FFA657\">component</span><span style=\"color: #C9D1D9\">, </span><span style=\"color: #FFA657\">options</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> {}) </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Setup options object</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.global </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.global </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> {}</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.global.plugins </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.global.plugins </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> []</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// create router if one is not provided</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">if</span><span style=\"color: #C9D1D9\"> (</span><span style=\"color: #FF7B72\">!</span><span style=\"color: #C9D1D9\">options.router) {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    options.router </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">createRouter</span><span style=\"color: #C9D1D9\">({</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">      routes: routes,</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">      history: </span><span style=\"color: #D2A8FF\">createMemoryHistory</span><span style=\"color: #C9D1D9\">(),</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    })</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  }</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Add router plugin</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.global.plugins.</span><span style=\"color: #D2A8FF\">push</span><span style=\"color: #C9D1D9\">({</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    </span><span style=\"color: #D2A8FF\">install</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #FFA657\">app</span><span style=\"color: #C9D1D9\">) {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">      app.</span><span style=\"color: #D2A8FF\">use</span><span style=\"color: #C9D1D9\">(options.router)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    },</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  })</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">return</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(component, options)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">})</span></span></code></pre>\n<p>Vue 2:</p>\n<pre is:raw=\"\" class=\"astro-code\" style=\"background-color: #0d1117; overflow-x: auto;\"><code><span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { mount } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'cypress/vue'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> Vue </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'vue'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> VueRouter </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'vue-router'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { router } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'../../src/router'</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">Cypress.Commands.</span><span style=\"color: #D2A8FF\">add</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'mount'</span><span style=\"color: #C9D1D9\">, (</span><span style=\"color: #FFA657\">component</span><span style=\"color: #C9D1D9\">, </span><span style=\"color: #FFA657\">options</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> {}) </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Add the VueRouter plugin</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  Vue.</span><span style=\"color: #D2A8FF\">use</span><span style=\"color: #C9D1D9\">(VueRouter)</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Use the router passed in via options,</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// or the default one if not provided</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.router </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.router </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> router</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">return</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(component, options)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">})</span></span></code></pre>\n<p>Usage:</p>\n<pre is:raw=\"\" class=\"astro-code\" style=\"background-color: #0d1117; overflow-x: auto;\"><code><span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> VueRouter </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'vue-router'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> Navigation </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'./Navigation.vue'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { routes } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'../router'</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #D2A8FF\">it</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'home link should be active when url is \"/\"'</span><span style=\"color: #C9D1D9\">, () </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// No need to pass in custom router as default url is '/'</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  cy.</span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(Navigation)</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  cy.</span><span style=\"color: #D2A8FF\">get</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'a'</span><span style=\"color: #C9D1D9\">).</span><span style=\"color: #D2A8FF\">contains</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'Home'</span><span style=\"color: #C9D1D9\">).</span><span style=\"color: #D2A8FF\">should</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'have.class'</span><span style=\"color: #C9D1D9\">, </span><span style=\"color: #A5D6FF\">'router-link-active'</span><span style=\"color: #C9D1D9\">)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">})</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #D2A8FF\">it</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'login link should be active when url is \"/login\"'</span><span style=\"color: #C9D1D9\">, () </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Create a new router instance for each test</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">const</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #79C0FF\">router</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">new</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">VueRouter</span><span style=\"color: #C9D1D9\">({</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    mode: </span><span style=\"color: #A5D6FF\">'history'</span><span style=\"color: #C9D1D9\">,</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    routes,</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  })</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Change location to `/login`</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  router.</span><span style=\"color: #D2A8FF\">push</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'/login'</span><span style=\"color: #C9D1D9\">)</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Pass the already initialized router for use</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  cy.</span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(Navigation, { router })</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  cy.</span><span style=\"color: #D2A8FF\">get</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'a'</span><span style=\"color: #C9D1D9\">).</span><span style=\"color: #D2A8FF\">contains</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'Login'</span><span style=\"color: #C9D1D9\">).</span><span style=\"color: #D2A8FF\">should</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'have.class'</span><span style=\"color: #C9D1D9\">, </span><span style=\"color: #A5D6FF\">'router-link-active'</span><span style=\"color: #C9D1D9\">)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">})</span></span></code></pre>\n<h3 id=\"vuex\">Vuex</h3>\n<p>To use a component that uses Vuex, create a mount command that configures a Vuex store for your component:</p>\n<p>Vue 3:</p>\n<pre is:raw=\"\" class=\"astro-code\" style=\"background-color: #0d1117; overflow-x: auto;\"><code><span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { mount } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'cypress/vue'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { getStore } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'../../src/plugins/store'</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">Cypress.Commands.</span><span style=\"color: #D2A8FF\">add</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'mount'</span><span style=\"color: #C9D1D9\">, (</span><span style=\"color: #FFA657\">component</span><span style=\"color: #C9D1D9\">, </span><span style=\"color: #FFA657\">options</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> {}) </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Setup options object</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.global </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.global </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> {}</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.global.stubs </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.global.stubs </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> {}</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.global.stubs[</span><span style=\"color: #A5D6FF\">'transition'</span><span style=\"color: #C9D1D9\">] </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #79C0FF\">false</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.global.components </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.global.components </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> {}</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.global.plugins </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.global.plugins </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> []</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Use store passed in from options, or initialize a new one</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">const</span><span style=\"color: #C9D1D9\"> { </span><span style=\"color: #79C0FF\">store</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">getStore</span><span style=\"color: #C9D1D9\">(), </span><span style=\"color: #FF7B72\">...</span><span style=\"color: #79C0FF\">mountOptions</span><span style=\"color: #C9D1D9\"> } </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Add Vuex plugin</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.global.plugins.</span><span style=\"color: #D2A8FF\">push</span><span style=\"color: #C9D1D9\">({</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    </span><span style=\"color: #D2A8FF\">install</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #FFA657\">app</span><span style=\"color: #C9D1D9\">) {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">      app.</span><span style=\"color: #D2A8FF\">use</span><span style=\"color: #C9D1D9\">(store)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    },</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  })</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">return</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(component, mountOptions)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">})</span></span></code></pre>\n<p>Vue 2:</p>\n<pre is:raw=\"\" class=\"astro-code\" style=\"background-color: #0d1117; overflow-x: auto;\"><code><span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { mount } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'cypress/vue'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> Vuex </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'vuex'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { getStore } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'../../src/plugins/store'</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">Cypress.Commands.</span><span style=\"color: #D2A8FF\">add</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'mount'</span><span style=\"color: #C9D1D9\">, (</span><span style=\"color: #FFA657\">component</span><span style=\"color: #C9D1D9\">, </span><span style=\"color: #FFA657\">options</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> {}) </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Setup options object</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.extensions </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.extensions </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> {}</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.extensions.plugins </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.extensions.plugins </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> []</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Use store passed in from options, or initialize a new one</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.store </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.store </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">getStore</span><span style=\"color: #C9D1D9\">()</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Add Vuex plugin</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.extensions.plugins.</span><span style=\"color: #D2A8FF\">push</span><span style=\"color: #C9D1D9\">(Vuex)</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">return</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(component, options)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">})</span></span></code></pre>\n<p>Usage:</p>\n<pre is:raw=\"\" class=\"astro-code\" style=\"background-color: #0d1117; overflow-x: auto;\"><code><span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { getStore } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'@/plugins/store'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> UserProfile </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'./UserProfile.vue'</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">it.</span><span style=\"color: #D2A8FF\">only</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'User profile should display user name'</span><span style=\"color: #C9D1D9\">, () </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">const</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #79C0FF\">user</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> { name: </span><span style=\"color: #A5D6FF\">'test person'</span><span style=\"color: #C9D1D9\"> }</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// getStore is a factory method that creates a new store</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">const</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #79C0FF\">store</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">getStore</span><span style=\"color: #C9D1D9\">()</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// mutate the store with user</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  store.</span><span style=\"color: #D2A8FF\">commit</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'setUser'</span><span style=\"color: #C9D1D9\">, user)</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  cy.</span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(UserProfile, {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">    store,</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  })</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  cy.</span><span style=\"color: #D2A8FF\">get</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'div.name'</span><span style=\"color: #C9D1D9\">).</span><span style=\"color: #D2A8FF\">should</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'have.text'</span><span style=\"color: #C9D1D9\">, user.name)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">})</span></span></code></pre>\n<h3 id=\"global-components\">Global Components</h3>\n<p>If you have components that are registered globally in the main application file, set them up in your mount command so your component will render them properly:</p>\n<p>Vue 3</p>\n<pre is:raw=\"\" class=\"astro-code\" style=\"background-color: #0d1117; overflow-x: auto;\"><code><span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { mount } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'cypress/vue'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> Button </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'../../src/components/Button.vue'</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">Cypress.Commands.</span><span style=\"color: #D2A8FF\">add</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'mount'</span><span style=\"color: #C9D1D9\">, (</span><span style=\"color: #FFA657\">component</span><span style=\"color: #C9D1D9\">, </span><span style=\"color: #FFA657\">options</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> {}) </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Setup options object</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.global </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.global </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> {}</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.global.components </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.global.components </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> {}</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Register global components</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.global.components[</span><span style=\"color: #A5D6FF\">'Button'</span><span style=\"color: #C9D1D9\">] </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> Button</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">return</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(component, options)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">})</span></span></code></pre>\n<p>Vue 2</p>\n<pre is:raw=\"\" class=\"astro-code\" style=\"background-color: #0d1117; overflow-x: auto;\"><code><span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> { mount } </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'cypress/vue'</span></span>\n<span class=\"line\"><span style=\"color: #FF7B72\">import</span><span style=\"color: #C9D1D9\"> Button </span><span style=\"color: #FF7B72\">from</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #A5D6FF\">'../../src/components/Button.vue'</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">Cypress.Commands.</span><span style=\"color: #D2A8FF\">add</span><span style=\"color: #C9D1D9\">(</span><span style=\"color: #A5D6FF\">'mount'</span><span style=\"color: #C9D1D9\">, (</span><span style=\"color: #FFA657\">component</span><span style=\"color: #C9D1D9\">, </span><span style=\"color: #FFA657\">options</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> {}) </span><span style=\"color: #FF7B72\">=></span><span style=\"color: #C9D1D9\"> {</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Setup options object</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.extensions </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.extensions </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> {}</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.extensions.plugins </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.extensions.plugins </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> []</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.extensions.components </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> options.extensions.components </span><span style=\"color: #FF7B72\">||</span><span style=\"color: #C9D1D9\"> {}</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #8B949E\">// Register global components</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  options.extensions.components[</span><span style=\"color: #A5D6FF\">'Button'</span><span style=\"color: #C9D1D9\">] </span><span style=\"color: #FF7B72\">=</span><span style=\"color: #C9D1D9\"> Button</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">  </span><span style=\"color: #FF7B72\">return</span><span style=\"color: #C9D1D9\"> </span><span style=\"color: #D2A8FF\">mount</span><span style=\"color: #C9D1D9\">(component, options)</span></span>\n<span class=\"line\"><span style=\"color: #C9D1D9\">})</span></span></code></pre>\n<p>See also <a href=\"https://docs.cypress.io/guides/component-testing/vue/api\">Cypress: Vue api</a></p>");

				const frontmatter = {};
